import FilterMethods from "@/assets/commonJS/FilterMethods";
import GetDataMethods from "@/assets/commonJS/GetDataMethods";
export default {
  data: function data() {
    return {
      loading: false,
      date: '',
      data: [],
      form: {
        adressList: [],
        qudaoList: [],
        model_adress: '',
        zdlx: '',
        model_qudao: '',
        date: '',
        searchmsg: '',
        xzqh: '',
        qd: ''
      },
      jjlx: {
        Diameter_Type: [],
        Field: ''
      },
      jslx: {
        Depth_Type: [],
        Field: ''
      },
      dllx: {
        Motivity_Type: [],
        Field: ''
      },
      gclx: {
        Material_Type: [],
        Field: ''
      },
      list_input: {
        total: 100,
        pagesize: 50,
        pagesizeopts: [10, 20, 50, 75, 100, 200],
        current: 1
      }
    };
  },
  // 引入过滤方法到此组件
  mixins: [FilterMethods, GetDataMethods],
  mounted: function mounted() {
    this.Reload();
  },
  methods: {
    err: function err() {
      // console.log("showDrawer",this.$showDrawer);
      this.$Message.warning('该功能还在开发中...');
    },
    search: function search() {
      if (this.form.searchmsg != '') {
        this.searchs = '&Well_Name=like,' + this.form.searchmsg;
      } else {
        this.searchs = '';
      }

      this.Reload();
    },
    indexMethod: function indexMethod(index) {
      return index + 1 + this.list_input.pagesize * (this.list_input.current - 1);
    },
    timechange: function timechange(date) {
      console.log(date);
      this.date = date;
    },
    Reload: function Reload() {
      var _this = this;

      this.loading = true;
      this.axios.get('/guanqu/admin/WRP_IrrBFSource_Well?_page_size=' + this.list_input.pagesize + '&_page=' + this.list_input.current + this.searchs, {
        params: {
          Diameter_Type: this.jjlx.Diameter_Type,
          Depth_Type: this.jslx.Depth_Type,
          Motivity_Type: this.dllx.Motivity_Type,
          Material_Type: this.gclx.Material_Type
        }
      }).then(function (res) {
        console.log(res);
        _this.loading = false;
        _this.data = res.data.rows;
        _this.list_input.total = res.data.total;

        for (var i = 0; i < _this.data.length; i++) {}
      }); //行政区划

      this.getTableData_WRP_AD_B(function (data) {
        _this.form.adressList = data;
      }); // 获取输排水渠道数据,然后设置渠道选择框选项

      this.getTableData_WRP_IrrBTCanalSystem(function (data) {
        _this.form.qudaoList = data;
      });
      this.axios.get('/guanqu/admin/WRP_FieldInfo?FieldID=Diameter_Type').then(function (res) {
        _this.jjlx.Diameter_Type = res.data.rows;
      });
      this.axios.get('/guanqu/admin/WRP_FieldInfo?FieldID=Depth_Type').then(function (res) {
        _this.jslx.Depth_Type = res.data.rows;
      });
      this.axios.get('/guanqu/admin/WRP_FieldInfo?FieldID=Motivity_Type').then(function (res) {
        _this.dllx.Motivity_Type = res.data.rows;
      });
      this.axios.get('/guanqu/admin/WRP_FieldInfo?FieldID=Material_Type').then(function (res) {
        _this.gclx.Material_Type = res.data.rows;
      });
    },
    // 处理页码切换
    CurrentChange: function CurrentChange(index) {
      // console.log(index);
      this.list_input.current = index;
      this.Reload();
    },
    // 处理每页显示条数切换
    PagesizeChange: function PagesizeChange(pagesize) {
      // console.log(pagesize)
      this.list_input.pagesize = pagesize;
      this.Reload();
    }
  }
};
